query RepositoryPickerInitialQuery(
  $ids: [ID!]!
) {
  nodes(ids: $ids) {
    __typename
    ...RepositoryPickerFragment
    id
  }
}

fragment RepositoryPickerFragment on Repository {
  id
  nameWithOwner
  isPrivate
  isArchived
}

