query UserPickerQuery(
  $slug: String!
  $query: String
) {
  enterprise(slug: $slug) {
    members(first: 10, query: $query) {
      nodes {
        __typename
        ... on EnterpriseUserAccount {
          user {
            ...UserPickerUserFragment
            id
          }
        }
        ... on Node {
          __isNode: __typename
          id
        }
      }
    }
    id
  }
}

fragment UserPickerUserFragment on User {
  id
  login
  name
  avatarUrl(size: 64)
}

