query OrganizationPickerRecentQuery(
  $slug: String!
  $query: String
) {
  enterprise(slug: $slug) {
    organizations(first: 50, query: $query, orderBy: {field: CREATED_AT, direction: DESC}) {
      totalCount
      nodes {
        ...OrganizationPickerFragment
        id
      }
    }
    id
  }
}

fragment OrganizationPickerFragment on Organization {
  id
  login
  avatarUrl
}

